css:
.palette {
  overflow-y: auto;
}
.palette .palette-controls {
  margin-bottom: 10px;
}
.palette .color {
  margin-bottom: 10px;
  border: 1px solid rgba(0, 0, 0, 0.5);
  overflow: hidden;
}
.palette .color:last-child {
  margin: 0;
}
.palette .color .color {
  border: none;
  margin: 0;
}
.palette .color .color-preview {
  display: block;
  float: left;
  margin-right: 10px;
  width: 60px;
  height: 60px;
  position: relative;
}
.palette .color .color-preview:before {
  content: '';
  background: url(atom://project-palette-finder/resources/transparent-background.png);
  position: absolute;
  left: 0;
  right: 0;
  top: 0;
  bottom: 0;
}
.palette .color .color-preview:after {
  content: '';
  background: inherit;
  position: absolute;
  left: 0;
  right: 0;
  top: 0;
  bottom: 0;
}
.palette .color .color-name {
  color: #65737f;
}
.palette .color .color-line {
  padding: 5px;
  margin-top: 5px;
}
.palette .color .color-path {
  color: #5786b8;
  margin-left: 10px;
}
.palette .grid .color {
  float: left;
  margin-right: 10px;
}
.palette .grid .color .color-preview {
  margin: 0;
}
.palette .grid .color .color-name,
.palette .grid .color .color-line,
.palette .grid .color .color-path {
  display: none;
}
